import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
  container: {
    flexDirection: "row",
    justifyContent: "space-between",
  },
  iconContainer: {
    flexDirection: "row",
    alignContent: "center",
  },
  number: {
    color: "grey",
    paddingLeft: 5,
    textAlign: "center",
  },
});

export default styles;
